description:
The Classic 1976 superhero crossover gets the XXX spoof treatment, courtesy of undisputed porn parody king Axel Braun and adult powerhouse Vivid Entertainment. When Doc Ock and Lex Luthor join forces to defeat their nemesis, Spidey and the Man of Steel meet for the first time and must work together to foil the evil duo's nefarious plans for world domination. Ryan Driller and Xander Corvus reprise their award-winning roles, and headline an all-star cast that includes Alexis Texas, Andy San Dimas, Capri Anderson, Kagney Linn Karter, Jenna Presley as Spider-Woman and an astounding Jazy Berlin as Black Cat. With lavish production values, spectacular VFX, and Braun's legendary attention to detail, SVS XXX is the porn parody event of the year!(Google Translation..)

